import ChristianName from "../components/christian";
import "../styles.css"
import { info } from "../info"; 

export default function Home() {
  return (
    <>
      <ChristianName />
      <h1>
        {info.intro}
      </h1>
      <p1>
        I am currently working at Capital One as a TDP Software Engineer. I have a strong passion for
        software development topics such as web development, machine learning, and AI.
      </p1>
    </>
  );
}
